import React, {Component} from "react";
import './Header.css'
class Header extends Component{
    render(){
        return(
            <div className="Header">
            <h1>En este ejercicio vimos:</h1>
            <h1>1. Tipos de componentes</h1>
            <h1>2. Funciones y eventos</h1>
            <h1>3. Uso de varios componentes</h1>
            </div>
        );
    }
}

export default Header;
